import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById("root"));

function MyButton() {
  return <button>Click me</button>;
}
export default function App() {
  return (
    <>
      <h1>Hello</h1>
      <MyButton />
    </>
  );
}

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
);
